import React, {Component , useState,useEffect} from 'react';
import PropTypes from 'prop-types';
import './css/map.css';
import {FormControl,MenuItem,Select} from "@material-ui/core"

class Map extends Component {



    render() {
        return (
            <div>

                <div className="map_header">

                    <h1>CoronaVirus Map</h1>

                    <FormControl className='map_dropdown'>

                        <Select value='abc' variant='outlined'>

                            <MenuItem value='Country'>Country1</MenuItem>
                            <MenuItem value='Country'>Country2</MenuItem>
                            <MenuItem value='Country'>Country3</MenuItem>
                            <MenuItem value='Country'>Country4</MenuItem>



                        </Select>


                    </FormControl>


                </div>


            </div>
        );
    }
}

Map.propTypes = {};

export default Map;
